        public class Translation
        {
            public string Name { get; set; }
            public string Description { get; set; }
        }
        public static void PopulateTranslations(LogFileManagment.SessionVariables session, Dictionary<string, Dictionary<string, Translate.Translation>> translations)
        {
            TranslateGameElements(session, translations);
        }

        public static string TranslateString(string part, LogFileManagment.SessionVariables session, Dictionary<string, Dictionary<string, Translate.Translation>> translations)
        {
            if (translations.ContainsKey(session.LocalLanguage))
                if (translations[session.LocalLanguage].ContainsKey((part ?? "").ToLower()))
                    return translations[session.LocalLanguage][part.ToLower()].Name;

            if (translations.ContainsKey("English"))
                if (translations["English"].ContainsKey((part ?? "").ToLower()))
                    return translations["English"][part.ToLower()].Name;

            return part;
        }

        public static string TranslateStringEnglish(string part, Dictionary<string, Dictionary<string, Translate.Translation>> translations)
        {
            if (translations.ContainsKey("English"))
                if (translations["English"].ContainsKey((part ?? "").ToLower()))
                    return translations["English"][part.ToLower()].Name;

            return part;
        }

